import { Router } from '@material-ui/icons';
import '../src/App.css';
import Chat from './Chat';
import Sidebar from './Sidebar';

function App() {
  return (
    //BEM naming covention

    <div className="app">

      <div className="app_body" >

        <Router>
          <Switch>
            <Sidebar />
            <Chat />
          </Switch>
        </Router>
      </div>
    </div>
  );
}

export default App;
